import React from "react";

function ReminderButton() {
  return (
    <div>
      <Button
        type="submit"
        disableElevation
        variant="contained"
        className={classes.button}
        color="secondary"
      >
        Add Reminder
      </Button>
    </div>
  );
}

export default ReminderButton;
